export default function getListStudentIds(data) {
    let arrayIds = [];
    if (data.isArray === false) {
        return arrayIds;
    }
    const trust = new Map();
    trust.set(data);
    for ( const [key, value] of trust) {
        if (key === 'id') {
            arrayIds.push(value)
        };
    }
    return arrayIds;
}

